pragma solidity ^0.5.17;

import "contracts/verifiers/Fin4BaseVerifierType.sol";

contract MinimumInterval is Fin4BaseVerifierType {

    constructor() public  {
        name = "sc.verifier.minimum-interval.name";
        description = "sc.verifier.minimum-interval.description";
        // minimumInterval = 1 * 24 * 60 * 60 * 1000; // 1 day
    }

    function submitProof_MinimumInterval(address tokenAddrToReceiveVerifierNotice, uint claimId) public {
        if (minimumIntervalRequirementMet(tokenAddrToReceiveVerifierNotice, msg.sender, claimId)) {
            _sendApprovalNotice(address(this), tokenAddrToReceiveVerifierNotice, claimId, "");
        } else {
            string memory message = string(abi.encodePacked(
                Fin4TokenStub(tokenAddrToReceiveVerifierNotice).name(),
                ": The time between your previous claim and this one is shorter than the minimum required timespan of ",
                uint2str(_getMinimumInterval(tokenAddrToReceiveVerifierNotice) / 1000), "s."
            ));
            _sendRejectionNotice(address(this), tokenAddrToReceiveVerifierNotice, claimId, message);
        }
    }

    function minimumIntervalRequirementMet(address tokenAddressUsingThisverifierType, address claimer, uint claimId) private view returns(bool) {
        /*
        uint timeBetween = Fin4TokenStub(tokenAddressUsingThisverifierType).getTimeBetweenThisClaimAndThatClaimersPreviousOne(claimer, claimId);
        return timeBetween >= _getMinimumInterval(tokenAddressUsingThisverifierType);
        */
        return true; // TODO
    }

